webpackJsonp([31766643674196],{616:function(o,s){o.exports={data:{site:{siteMetadata:{title:"Magicly's Blog",author:"Magicly"}},markdownRemark:{id:"/Users/spring/Developer/Gatsby/springjphoenix.github.io/src/pages/go-vscodego-no-tip.md absPath of file >>> MarkdownRemark",html:'<p>最近用Go写代码，在VSCode下安装了vscodego插件， 语法高亮、代码提示、代码跳转、错误提示等都支持， 完美！</p>\n<p>不知道哪天突然发现没有代码提示了， 只有提示”PANIC”。。。。。</p>\n<p>经过google， 发现代码提示用的是<a href="https://github.com/nsf/gocode">gocode</a>，也<a href="https://tonybai.com/2016/12/23/write-go-code-in-vscode/">有人遇到过</a>，手动重启gocode即可。</p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code class="language-bash">gocode close\ngocode -s</code></pre>\n      </div>\n<p>执行之后还是不行， 有报错：</p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code class="language-bash">panic: unknown <span class="token function">export</span> <span class="token function">format</span> version 5 <span class="token punctuation">(</span><span class="token string">"version 5"</span><span class="token punctuation">)</span></code></pre>\n      </div>\n<p>拿去google， 找到gocode里的<a href="https://github.com/nsf/gocode/issues/456">issues</a>， 提示说可以升级gocode：</p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code class="language-bash">go get -u -v github.com/nsf/gocode\n``<span class="token variable"><span class="token variable">`</span>\n再重启， 一起ok了！\n\nPS， 发现升级之后其实vscode在遇到go代码并且你需要代码提示（按了.）的时候如果没有检测到gocode daemon进程，会自动帮你启动gocode的。会启动一个进程监听<span class="token variable">`</span></span>127.0.0.1:37373`端口。</code></pre>\n      </div>',timeToRead:1,frontmatter:{title:"VSCode go插件代码提示失效",date:"2018-03-22",category:"Go",tags:["vscode","go","gocode"],math:null}}},pathContext:{prev:{url:"/concurrency-by-promise/",title:"用Promise实现并发 vs Go goroutine"},slug:"/go-vscodego-no-tip/",next:{url:"/blockchain-btc-mining/",title:"区块链系列一：现在挖比特币有多难"}}}}});
